import React from "react";
import { ClickCounter } from "./ClickCounter";

export class Counter extends React.Component {
  state = {
    count: this.props.initialValue,
  };


  render() {
    return (
      <div>
        <ClickCounter counter={this.state.count} />
      </div>
    );
  }
}

Counter.defaultProps = {
  initialValue: 0,
  incrementBy: 1,
};
